import React, { Component } from "react";
import Footer from "../../components/footer/footer";
import Navbar from "../../components/navbar/navbar";
import axios from "axios";
import ProjectCard from "../../components/Projects-cards/project.cards";
// const project = [
//   { title: "hello", desc: "project1" },
//   { title: "hello2", desc: "project2" },
//   { title: "hello3", desc: "project3" },
//   { title: "hello", desc: "project1" },


// ];

export default class Projects extends Component {
  constructor(props) {
    super(props);

    // this.deleteProjects = this.deleteProjects.bind(this)

    this.state = { Projects: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5007/create/")
      .then((response) => {
        this.setState({ Projects: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    return (<div>
       <Navbar />
      <div className="cards">
      {this.state.Projects &&
          this.state.Projects.map((item, index) => {
          return    <div class="container" key={item._id} >
          <div class="card">
            <img src="//unsplash.it/399/400" alt="" class="card-img"></img>
            <div class="card-text">
              <h3 class="card-title">{this.props.data.title}</h3>
              <p class=" card-body">{this.props.data.description}</p>
            </div>
          </div>
        </div>;
        })}

      </div>
      <Footer />
      </div>
    );
  }
}
